// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";

import "./../NFTManager.sol";
import "./../Pool/AvatarPool.sol";
import "./../Pool/StonePool.sol";
import "./../Pool/WearablePool.sol";
import "./../BaseStructs.sol";
import "./Box.sol";
import "./../../Season.sol";


/// @custom:security-contact giorgio@allena.it
contract Minting is Ownable, BaseStructs{

    address private NFTManagerAddress;
    address private BoxAddress;

    address private avatarPoolAddress;
    address private stonePoolAddress;
    address private wearablePoolAddress;

    address private seasonAddress;

    uint256 private mintingFee;
    uint256 private mintingValue;


    constructor(
        address _NFTManagerAddress, 
        address _BoxAddress,
    
        address _avatarPoolAddress,
        address _stonePoolAddress,
        address _wearablePoolAddress,

        address _seasonAddress,

        uint256 _mintingFee
    ) {
        NFTManagerAddress = _NFTManagerAddress;
        BoxAddress = _BoxAddress;

        avatarPoolAddress = _avatarPoolAddress;
        stonePoolAddress = _stonePoolAddress;
        wearablePoolAddress = _wearablePoolAddress;

        seasonAddress = _seasonAddress;

        mintingFee = _mintingFee;
        

        // TODO: Get price from a matrix
        // price minting: 
        mintingValue = 100;
    }



    /*
        SET & GET
    */
    function setNFTManagerAddress(address _NFTManagerAddress) onlyOwner public { NFTManagerAddress = _NFTManagerAddress; }
    function setAvatarPoolAddress(address _avatarPoolAddress) onlyOwner public { avatarPoolAddress = _avatarPoolAddress; }

    function getMintingFee() public view returns(uint256) { return mintingFee; }
    function setMintingFee(uint256 _mintingFee) onlyOwner public { mintingFee = _mintingFee; }

    function setMintingValue(uint256 _mintingValue) onlyOwner public { mintingValue = _mintingValue; }
    function getMintingValue() public view returns(uint256) { return mintingValue; }

    function setSeasonAddress(address _seasonAddress) onlyOwner public { seasonAddress = _seasonAddress; }
    function getSeasonAddress() public view returns(address) { return seasonAddress; }

    function setBoxAddress (address _BoxAddress) public onlyOwner { BoxAddress = _BoxAddress; }
    function getBoxAddress () public view returns (address) { return BoxAddress; }


    /*
        METHODS
    */
    function mintingAvatar(
        uint256 idNFT1,  
        uint256 idNFT2
    ) public payable {
        // Check NFTs can be minted. See if there are a NFT free. Also sign all the data
        require(canBeMinted(idNFT1, idNFT2), "NFTs can not be minted");
        uint256 tokenRarity;
        uint256 objKey = 4;

        // TODO: Minting Price ? 
        // Cambia nel tempo
        // Put a variable
        // Set setting with minting time

        uint256 currentSeason = Season(seasonAddress).getCurrentSeason();

        // set rarity
        if (
            AvatarPool(avatarPoolAddress).getAvatarInfo(idNFT1).id > 0 && 
            AvatarPool(avatarPoolAddress).getAvatarInfo(idNFT2).id > 0 
        ) {
            tokenRarity = AvatarPool(avatarPoolAddress).getRarityForMinting( 
                AvatarPool(avatarPoolAddress).getAvatarInfo(idNFT1).ar, 
                AvatarPool(avatarPoolAddress).getAvatarInfo(idNFT2).ar
            );

            objKey = 0;
        } else if (
            StonePool(stonePoolAddress).getStoneInfo(idNFT1).id > 0 && 
            StonePool(stonePoolAddress).getStoneInfo(idNFT2).id > 0
        ) {
            tokenRarity = StonePool(stonePoolAddress).getRarityForMinting(
                StonePool(stonePoolAddress).getStoneInfo(idNFT1).ar, 
                StonePool(stonePoolAddress).getStoneInfo(idNFT2).ar );

            objKey = 1;
        } else if (
            WearablePool(wearablePoolAddress).getWearableInfo(idNFT1).id > 0 && 
            WearablePool(wearablePoolAddress).getWearableInfo(idNFT2).id > 0
        ) {
            tokenRarity = WearablePool(wearablePoolAddress).getRarityForMinting(
                WearablePool(wearablePoolAddress).getWearableInfo(idNFT1).ar, 
                WearablePool(wearablePoolAddress).getWearableInfo(idNFT2).ar );

            objKey = 2;
        } else return;

        require(msg.value >= AvatarPool(avatarPoolAddress).getAvatarPoolInfo(currentSeason, tokenRarity).cost, "Check minting price before try to send a new transaction");
        Box(BoxAddress).createANewBox(objKey, tokenRarity);
    }



    function canBeMinted(
        uint256 idNFT1,
        uint256 idNFT2
    ) public view returns(bool state) {
        // require(NFTManager(NFTManagerAddress).method(), "NFT not exist");
        // TODO: Check NFT property

        // TODO: Check NFTs are not yet minted

        // TODO: Aumento di prezzo se gi mintato

        // TODO: Numero massimo di volte in cui un NFT singolo pu essere mintato ( 5 ). Pu essere aumentato il blocco.



        // TODO: Check level nfts

        // TODO: Check time



        state = true;
    }

}
